import './App.js';
import React, { useState } from 'react';

function App(props) {
	let [count, setCount] = useState(0);
  return (
    <div className="App">
	<nav className="nav-bar">
		<h1 className="top-header">{props.name} and React</h1>
	</nav>
	<div>
		<p className="display">Count: {count}</p>
		<button onclick={()=> setCount(count +1)}>
		Click me!
		</button>
	</div>
    </div>
  );
}

export default App;
